#include <stdio.h>

int count_AGCTTA(char gene[]);
int genetic_engineering(char gene[]);

int main(void)
{
  char gene[] = "";
  printf("AGCTTA: %d\n", count_AGCTTA(gene));
  genetic_engineering(gene);
  return 0;
}

int count_AGCTTA(char gene[]) {
  int count = 0;
  int i = 0;
  while (gene[i] != '\0') {
    if (gene[i] == 'A') {
      if (gene[i + 1] == 'G') {
        if (gene[i + 2] == 'C') {
          if (gene[i + 3] == 'T') {
            if (gene[i + 4] == 'T') {
              if (gene[i + 5] == 'A') {
                count++;
              }
            }
          }
        }
      }
    }
    i++;
  }
  return count;
}

int genetic_engineering(char gene[]) {
  int count = 0;
  int i = 0;
  while (gene[i] != '\0') {
    if (gene[i] == 'G') {
      if (gene[i + 1] == 'T') {
        if (gene[i + 2] == 'A') {
          if (gene[i + 3] == 'C') {
            if (gene[i + 4] == 'A') {
              printf("AAA");
              i += 5;
              continue;
            }
          }
        }
      }
    }
    printf("%c", gene[i]);
    i++;
  }
}
